(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))).^2.*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(2)))) - c24.*(2.*cos(x(3)).*sin(x(1)).*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).^2.*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))) - 2.*sin(x(3)).*sin(x(1)).*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))).^2) - c25.*(2.*cos(x(3)).*sin(x(1)).*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).^2.*(cos(x(2)).*sin(x(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))) - 2.*sin(x(3)).*sin(x(1)).*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))).^2.*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(2)))) + c16.*(2.*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).*(cos(x(2)).*sin(x(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))).^2.*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(2))) + 2.*(cos(x(2)).*sin(x(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))).*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))).*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(2))).^2) + c26.*(2.*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).^2.*(cos(x(2)).*sin(x(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))).*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))) + 2.*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))).^2.*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(2)))) + c12.*((cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).^2.*(cos(x(2)).*sin(x(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))).^2 + (sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))).^2.*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(2))).^2) - c45.*(4.*cos(x(3)).*sin(x(3)).*sin(x(1)).^2.*(cos(x(3)).*sin(x(2)) + cos(x(2)).*cos(x(1)).*sin(x(3))).*(cos(x(2)).*sin(x(3)) + cos(x(3)).*cos(x(1)).*sin(x(2))) + 4.*cos(x(3)).*sin(x(3)).*sin(x(1)).^2.*(sin(x(3)).*sin(x(2)) - cos(x(3)).*cos(x(2)).*cos(x(1))).*(cos(x(3)).*cos(x(2)) - cos(x(1)).*sin(x(3)).*sin(x(