        f44 = @(y)-(c44.*(cos(y(3)).*cos(y(2)) - 2.*cos(y(3)).*cos(y(2)).*cos(y(1)).^2 + cos(y(1)).*sin(y(3)).*sin(y(2))).^2 - c26.*(2.*cos(y(2)).*sin(y(2)).*sin(y(1)).^2.*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2)).*cos(y(1))).^2 - 2.*cos(y(2)).^2.*sin(y(1)).^2.*(cos(y(2)).*sin(y(3)) + cos(y(3)).*cos(y(1)).*sin(y(2))).*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2)).*cos(y(1)))) + c55.*(2.*cos(y(3)).*cos(y(1)).^2.*sin(y(2)) - cos(y(3)).*sin(y(2)) + cos(y(2)).*cos(y(1)).*sin(y(3))).^2 - c16.*(2.*cos(y(2)).*sin(y(2)).*sin(y(1)).^2.*(cos(y(2)).*sin(y(3)) + cos(y(3)).*cos(y(1)).*sin(y(2))).^2 - 2.*sin(y(2)).^2.*sin(y(1)).^2.*(cos(y(2)).*sin(y(3)) + cos(y(3)).*cos(y(1)).*sin(y(2))).*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2)).*cos(y(1)))) + c45.*(2.*cos(y(1)).^2.*(cos(y(2)).*sin(y(3)) + cos(y(3)).*cos(y(1)).*sin(y(2))).*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2)).*cos(y(1))) - 2.*cos(y(3)).^2.*cos(y(2)).*sin(y(2)).*sin(y(1)).^4 + 2.*cos(y(3)).*cos(y(2)).*cos(y(1)).*sin(y(1)).^2.*(cos(y(2)).*sin(y(3)) + cos(y(3)).*cos(y(1)).*sin(y(2))) - 2.*cos(y(3)).*cos(y(1)).*sin(y(2)).*sin(y(1)).^2.*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2)).*cos(y(1)))) + c66.*sin(y(1)).^2.*(2.*cos(y(2)).^2.*sin(y(3)) - sin(y(3)) + 2.*cos(y(3)).*cos(y(2)).*cos(y(1)).*sin(y(2))).^2 + c33.*cos(y(3)).^2.*cos(y(1)).^2.*sin(y(1)).^2 - 2.*c46.*sin(y(1)).*(cos(y(3)).*cos(y(2)) - 2.*cos(y(3)).*cos(y(2)).*cos(y(1)).^2 + cos(y(1)).*sin(y(3)).*sin(y(2))).*(2.*cos(y(2)).^2.*sin(y(3)) - sin(y(3)) + 2.*cos(y(3)).*cos(y(2)).*cos(y(1)).*sin(y(2))) + c22.*cos(y(2)).^2.*sin(y(1)).^2.*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2)).*cos(y(1))).^2 - 2.*c56.*sin(y(1)).*(2.*cos(y(3)).*cos(y(1)).^2.*sin(y(2)) - cos(y(3)).*sin(y(2)) + cos(y(2)).*cos(y(1)).*sin(y(3))).*(2.*cos(y(2)).^2.*sin(y(3)) - sin(y(3)) + 2.*cos(y(3)).*cos(y(2)).*cos(y(1)).*sin(y(2))) + c11.*sin(y(2)).^2.*sin(y(1)).^2.*(cos(y(2)).*sin(y(3)) + cos(y(3)).*cos(y(1)).*sin(y(2))).^2 - 2.*c24.*cos(y(2)).*sin(y(1)).*(sin(y(3)).*sin(y(2)) - cos(y(3)).*cos(y(2))